[virtual_sdcard]
path: /home/Voron/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

########################################################################
        #   Controllers
########################################################################
[mcu]
##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
canbus_uuid: f2899e8cc013
#restart_method: command
########################################################################
        #  Cartographer Probe
########################################################################
#cartographer_touch_z_offset: 0.05         
#this is the default and will be overwritten and added to the DO NOT SAVE area by using UI to save z offset
#samples: 5
#samples_result: median
#samples_tolerance: 0.006
#samples_tolerance_retries: 3

[mcu cartographer] # See https://www.klipper3d.org/Config_Reference.html#mcu
# Remove either the serial or canbus_uuid line dependant on your setup.
canbus_uuid: 64f0332ae734

[cartographer]
mcu: cartographer
x_offset: 0 # This is the offset of your probe from the nozzle tip, to the centre of the coil.
y_offset: 25 # This is the offset of your probe from the nozzle tip, to the centre of the coil.
verbose: yes # For extra output

[cartographer scan]
#probe_speed: 5
#   Speed (in mm/s) of the Z axis when probing. The default is 5mm/s.
#mesh_runs: 1
#   Number of runs when doing a scan mesh.
#   Consecutive runs will trace back the way it came from.
#   The default is 1 run.
#mesh_direction: x
#   Axis of which to do the most moves along - either 'x' or 'y'.
#   The default is the x-axis
#mesh_height: 3
#   The height (in mm) of the head, when doing a mesh run.
#   The default is 3 mm.
#mesh_path: snake
#   The path to use when calibrating a scan mesh - either 'snake',
#   'alternating_snake', 'spiral' or 'random'.
#   The default is snake.

[cartographer touch]
#samples: 3
#   The number of samples to use when doing a touch.
#   The default is 3.
#max_samples: 10
#   The maximum number of samples to do before giving up.
#   The default is samples * 2, but minimum 10.
#UNSAFE_max_touch_temperature: 150
#   The maximum allowed nozzle temperature to use when touching the plate.
#   This is set to 150C to avoid damaging your plate.
#   Change this AT YOUR OWN RISK.
#   The default is 150C.

########################################################################
        #  EBB SB2209 RP2040 Toolhead Board
########################################################################
[mcu ToolHead]
canbus_uuid: ae34c0ca80bc
########################################################################
        # Raspberry Pi
########################################################################
[mcu rpi]
serial: /tmp/klipper_host_mcu
########################################################################
        # MCU Fan
